import React from 'react';
import Eljardin from '../assets/eljardin.png';

const Pictureandtext = () => {
  return (
    <div className='w-[80%] mx-auto my-20 rounded-3xl drop-shadow-2xl py-3 px-3 bg-white py-30 transform   hover:bg-z-600 transition duration-500 hover:scale-105'>
        <div className='w-[80%] mx-auto py-3 px-3 '>
      <div className='max-w-[1240px] mx-auto grid md:grid-cols-2 '>
        <img className='w-[100%] mx-auto my-3' src={Eljardin} alt='/' />
        <div className='flex flex-col justify-center'>


<div className='text-center '>
          <h1 className='md:text-4xl sm:text-3xl text-xl font-bold px-3 py-3'>El Jardin, my latest proyect!</h1>

          <p className='mx-20 md:text-2xl sm:text-1xl '>
          El Jardín permitirá crear una conexión entre todos los artistas y es nuestro trabajo, crear ese vínculo.
          </p>
          <h1 className='text-transparent text-1xl bg-clip-text bg-gradient-to-r from-blue-400 to-blue-600 rounded-md font-medium  my-2x mx-3 py-6 md:text-2xl sm:text-1xl  '>Get Started</h1>
          </div>
        </div>
      </div>
      </div>
    </div>
  );
};

export default Pictureandtext;
